import React from "react";
import {Link} from "react-router-dom";

const Header = () => {
    return (
        <div className="header">
            <Link to="/">
                <button className="btn3">{"<"}</button>
            </Link>
            <div className="Header-container">
                <h2>Contact Manager</h2>
            </div>
        </div>
    );
};

export default Header;
